import "./team.css";
import bench from "./img/bench.png";
import Player from "../players/player";
import { useEffect } from "react";

const Team = ({ teamSize }) => {
  useEffect(() => {
    const players = [teamSize];
    console.log("teamSize", players);
  });

  return (
    <div className="teamBench" style={{ backgroundImage: `url(${bench})` }}>
      {players.map((player) => (
        <Player></Player>
      ))}
    </div>
  );
};

export default Team;
